import { Text, View, StyleSheet, ImageBackground, Dimensions } from 'react-native'


const width = Dimensions.get("window")
const height = Dimensions.get("window")


function HomeScreen() {
  return (
    <ImageBackground
        style={styles.background}
        source={{uri:("https://media.istockphoto.com/photos/park-guell-in-barcelona-spain-picture-id148543868?k=20&m=148543868&s=612x612&w=0&h=2pCAExLqNq9rKpCiTKb6Z2YKV-SxM35YG7WQVMimhmQ=")}}
    >
        <Text>Welcome to Barcelona</Text>
    </ImageBackground>
  )
}

export default HomeScreen

const styles = StyleSheet.create({
    background: {
        width: width,
        height: height
    }
})
